import React from 'react';
import {GitHub, Telegram, Website} from "./util";



function App() {
  return (
      <div className={'container-fluid main'}>
            <div className="container row justify-content-center ">
                <img src={Website} alt={'#'} className={'col-4'}/>
                <img src={GitHub} alt={'#'} className={'col-4 '}/>
                <img src={Telegram} alt={'#'} className={'col-4'}/>
            </div>
      </div>
  );
}

export default App;
